import styled from 'styled-components';

const Container = styled.div`
	display: flex;
	img {
		height: 8rem;
		width: 8rem;
	}
`;

const FooterLogo = styled.div`
	display: flex;
	align-items: center;
`;

export { Container, FooterLogo };
